import React from "react";
import { connect } from "react-redux";

function BarGraph({ scores }) {
  const bars = () => {
    for (const track in scores) {
      console.log(track);
    }
  };
  return <div>{bars()}</div>;
}
const mapStateToProps = state => {
  return {
    scores: state.scores
  };
};
export default connect(mapStateToProps, {})(BarGraph);
